import styled from 'styled-components';

type Props ={
   style: string 
}

export const DeafaultSection = styled.div<Props>`
    height: 90vh;
    ${props => (props.style ? props.style: '')}
`;
export const Header = styled.h1`
    text-align: center;
`;
